import './App.css'
import Header from './components/header';



function App() {
  const data = "a sample data from app"
  return (
    <div>
      <Header data={data} />
      <h1 className='hello'>Hello World</h1>    
      <p>This is a sample statement.</p>
    </div>
  );
}

export default App;
